import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link as RouterLink } from 'react-router-dom';
import axios from 'axios';
import {
  Button,
  TextField,
  Typography,
  Container,
  Card,
  CardContent,
  Grid,
  IconButton
} from '@mui/material';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import ViewNominee from './ViewNominee';  // Make sure this component is properly imported

function NomineeDetails() {
    const { nomineeId } = useParams();
    const navigate = useNavigate();
    const [details, setDetails] = useState([]);
    const [nomineeName, setNomineeName] = useState('');
    const [currentIndex, setCurrentIndex] = useState(0);
    const [openDialog, setOpenDialog] = useState(false);

    useEffect(() => {
        axios.get(`http://127.0.0.1:5000/review/nominee/${nomineeId}/details`, {
            headers: { Authorization: `Bearer ${localStorage.getItem('authToken')}` }
        })
        .then(response => {
            if (response.data.length > 0) {
                setNomineeName(response.data[0].nominee_name);
                setDetails(response.data.slice(1));
            }
        })
        .catch(error => {
            console.error('Error fetching nominee details:', error);
            navigate('/dashboard');
        });
    }, [nomineeId, navigate]);

    const handleBack = () => {
        navigate(-1);
    };

    const goToNext = () => {
        setCurrentIndex((prev) => (prev + 1) % details.length);
    };

    const goToPrevious = () => {
        setCurrentIndex((prev) => prev === 0 ? details.length - 1 : prev - 1);
    };

    const handleDialogOpen = () => {
        setOpenDialog(true);
    };

    const handleDialogClose = () => {
        setOpenDialog(false);
    };

    return (
        <Container maxWidth="md">
            <Card raised>
                <CardContent>
                    <Typography variant="h4" gutterBottom>
                        Details for Nominee: <Button component={RouterLink} to={`/nominee/${nomineeId}/info`} onClick={handleDialogOpen} style={{ textDecoration: 'none', color: 'inherit' }}>
                            {nomineeName}
                        </Button>
                    </Typography>
                    <Button variant="contained" color="primary" onClick={handleBack} sx={{ mb: 2 }}>
                        Go Back
                    </Button>
                    {details.length > 0 ? (
                        <form>
                            <Grid container spacing={2}>
                                {/* Display details for the current recommendation */}
                                {[
                                    { key: 'ic_q1', question: 'Personally, became aware of the importance of his/her extraordinary accomplishments and their impact on the company.' },
                                    { key: 'ic_q2', question: 'List technical patents; technical reports and presentations; development of products, applications and systems; and application of facilities and services.' },
                                    { key: 'ic_q3', question: 'Comparing with people in this position.' },
                                    { key: 'ic_q4', question: 'What’s the expansion of job responsibility.' },
                                    { key: 'ic_q5', question: 'What is the future development area, what’s manager’s plan for the career development.' }
                                ].map(field => (
                                    <Grid item xs={12} key={field.key}>
                                        <TextField
                                            fullWidth
                                            label={field.question}
                                            value={details[currentIndex][field.key] || ''}
                                            InputProps={{
                                                readOnly: true,
                                            }}
                                            variant="outlined"
                                            margin="normal"
                                        />
                                    </Grid>
                                ))}
                                <Grid item container justifyContent="space-between" xs={12}>
                                    <IconButton onClick={goToPrevious}>
                                        <ArrowBackIosIcon />
                                    </IconButton>
                                    <IconButton onClick={goToNext}>
                                        <ArrowForwardIosIcon />
                                    </IconButton>
                                </Grid>
                            </Grid>
                        </form>
                    ) : (
                        <Typography>No details available</Typography>
                    )}
                </CardContent>
            </Card>
            <Dialog open={openDialog} onClose={handleDialogClose} fullWidth maxWidth="sm">
                <ViewNominee id={nomineeId} onClose={handleDialogClose} />
            </Dialog>
        </Container>
    );
}

export default NomineeDetails;
